// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-blue-500 p-4">
      <div className="container mx-auto flex justify-between items-center">
        <div>
          <Link to="/" className="text-white font-semibold text-lg mr-4">Home</Link>
          <Link to="/weather" className="text-white font-semibold text-lg mr-4">Weather</Link>
          <Link to="/crop-prediction" className="text-white font-semibold text-lg mr-4">Crop Prediction</Link>
        </div>
        <div className="bg-white rounded-full p-2 flex items-center">
          <input
            type="text"
            placeholder="Search..."
            className="w-64 p-2 outline-none"
          />
          <button className="bg-blue-500 text-white p-2 rounded-full ml-2">
            Search
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
